import data from './../Data/Superheroes'
import React from 'react';


const SwitchMarvel = () => {
const Handler = () => {
    alert(data.marvel);
}
    return (
        <div className='ctalog' >
            {data.marvel.map((item, index) =>
                <div className='catalog1'onClick={Handler}>
                    <img src={item.image}></img>
                    <p>{item.name}</p>
                </div>
            )}
        </div>
    )
};


export default SwitchMarvel;
